@import url('https://fonts.googleapis.com/css2?family=Cinzel+Decorative:wght@900&family=Open+Sans&display=swap');
@import './variables';
@import './resets';
@import './navbar';
@import './sections';
@import './animations';
@import './project_card';
@import './footer';
@import './media';

/* Base styles */
html {
  box-sizing: border-box;
  font-size: 62.5%;

  /* Set font size for easy rem calculations
   * default document font size = 16px, 1rem = 16px, 100% = 16px
   * (100% / 16px) * 10 = 62.5%, 1rem = 10px, 62.5% = 10px
  */
}
body {
  background: $dark-purp;
  font-family: 'Open Sans', sans-serif;
  font-size: 1.8rem; /* 18px */
  font-weight: 400;
  line-height: 1.4;
  color: $off-white;
}
h1 {
  font-size: 6rem;
}
h2 {
  font-size: 4.2rem;
}
ul {
  list-style: none;
}
a {
  text-decoration: none;
  color: $light-pink;
}
img {
  display: block;
  width: 100%;
}
button.btn {
  padding: 0.5em;
  border: 2px solid $light-pink;
  color: $light-pink;
  background: transparent;
  &:hover {
    color: $dark-purp;
    background: $light-pink;
    transition: 0.3s cubic-bezier(0.39, 0.575, 0.565, 1);
    cursor: pointer;
  }
}
.container {
  max-width: 100vw;
  width: 100%;
  display: flex;
  position: relative;
}

