@import './hamburger';

/*top navbar*/
.header {
  position: fixed;
  display: flex;
  flex-direction: row;
  width: 100%;
  height: 5.2em;
  z-index: 10;
}
.header-bg {
  position: absolute;
  margin: 0;
  width: 100%;
  height: 100%;
  will-change: transform;
  transform: scaleY(0);
  background-color: $dark-purp;
}

.header-inner {
  position: relative;
  width: 100%;
  height: 100%;
  max-width: 1400px;
  margin: 0 auto;
  text-align: left;
}
.nav-links a {
  position: relative;
  transition: color 0.25s ease;
}
#navbar .nav-links {
  position: relative;
  display: flex;
  width: 25%;
  padding: 0;
  margin: 3% 0 0 75%;
  font-size: 2rem;
  font-weight: 400;
  color: $light-pink;
  list-style-type: none;
}
#navbar {
  width: 95%;
  list-style-type: none;
  z-index: 50;
}
#navbar .nav-item {
  margin: 0 0.7em;
}
/*nav links underline hover animation*/
#navbar .nav-links li a:after {
  content: '';
  position: absolute;
  bottom: 0;
  left: 0;
  width: 100%;
  height: 1px;
  background: $light-pink;
  transform: scaleX(0);
  transform-origin: right center;
  transition: transform 0.6s;
}
#navbar .nav-links li a:hover:after {
  transition-duration: 0.4s;
  transform: scaleX(1);
  transform-origin: left center;
}
/*nav links animation end*/
/*side nav menu*/
#side-menu {
  position: fixed;
  top: 0;
  right: 0;
  height: 100%;
  z-index: 10;
  width: 0;
  background: $dark-purp;
  transition: cubic-bezier(0.42, 0.33, 0.3, 0.83) 0.6s;
}

#side-menu-nav {
  width: 200px;
  height: 100vh;
  margin: 20% 15%;
}
/*end*/
#side-menu-nav .nav-links {
  display: flex;
  flex-direction: column;
  width: 100%;
  margin: 0;
  opacity: 0;
}
#side-menu-nav .nav-links li {
  padding: 0.5em 0;
  text-align: right;
  border-bottom: 1pt solid #f6accb15;
}

#side-menu-nav .nav-links li.primary {
  display: none;
}

#side-menu-nav .nav-links a {
  width: inherit;
  font-weight: 200;
  font-size: 1.2em;
  color: $light-pink;
}
#side-menu-nav .nav-links a:hover {
  opacity: 0.8;
}
button .hamburger-inner {
  background-color: $light-pink !important;
}

button .hamburger-inner::before {
  background-color: $light-pink !important;
}
button .hamburger-inner::after {
  background-color: $light-pink !important;
}
button.hamburger {
  visibility: hidden;
  z-index: 10;
}
button.hamburger:focus,
button.hamburger:active {
  outline: none;
}

